import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './login/Login';
import SignUp from './login/SignUp';




function App() {
  return (
    <div>
        <BrowserRouter>
                <Routes>
                    <Route path={'/login'} element={Login}></Route>
                    <Route path={'/signup'} element={SignUp}></Route>
                </Routes>
        </BrowserRouter>
     <h1>OKE

     </h1>
     </div>
  );
}

export default App;
